from typing import List


def f1(f1_p1: str) -> str:
    f1_v1 = list(f1_p1)
    if len(f1_p1) <= 2:
        return f1_p1

    f1_v2: List[str] = list()
    f1_v3: int = len(f1_v1)
    f1_v4: int = f1_v3 // 2
    for f1_v5 in range(0, len(f1_v1)):
        if f1_v5 < f1_v4:
            f1_v2.append(f1_v1[f1_v5])
            if 2 * (f1_v5 + 1) != f1_v3:
                f1_v2.append('(')
        elif f1_v5 > f1_v4:
            f1_v2.append(')')
            f1_v2.append(f1_v1[f1_v5])
        else:
            f1_v2.append(f1_v1[f1_v5])

    return ''.join(f1_v2)


